import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

let posts = [
    {id: 1, message: 'Hi, how are you?', likesCount: 12},
    {id: 2, message: 'It\'s my first post', likesCount: 11},
    {id: 2, message: 'Some message', likesCount: 9},
    {id: 2, message: 'I don\'t know what to say', likesCount: 5},
]

let dialogs = [
    {id: 1, name: 'Dymich'},
    {id: 2, name: 'Andrey'},
    {id: 3, name: 'Sveta'},
    {id: 4, name: 'Viktor'},
    {id: 5, name: 'Valera'},
    {id: 6, name: 'Sasha'},
]

let messages = [
    {id: 1, message: 'Hi'},
    {id: 2, message: 'How is your mood?'},
    {id: 3, message: 'Yo'},
    {id: 4, message: 'Yo'},
    {id: 5, message: 'Yo'},
    {id: 6, message: 'Yo'},
]

ReactDOM.render(
    <App
        posts={posts}
        dialogs={dialogs}
        messages={messages}
    />,
  document.getElementById('root')
);
